// RegisterDoctor.jsx
import React, { useState } from "react";
import api from "../../../api";

export default function RegisterDoctor() {
  const [form, setForm] = useState({});

  const handleChange = (e) => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    await api.post("/admin/register-doctor", form);
    alert("Doctor Registered ✅");
  };

  return (
    <form onSubmit={handleSubmit}>
      <input name="firstName" onChange={handleChange} placeholder="First Name" />
      <input name="lastName" onChange={handleChange} placeholder="Last Name" />
      <input name="specialization" onChange={handleChange} placeholder="Specialization" />
      <input name="phoneNumber" onChange={handleChange} placeholder="Phone Number" />
      <input name="qualification" onChange={handleChange} placeholder="Qualification" />
      <input name="availabilityHours" onChange={handleChange} placeholder="Availability Hours" />
      <button type="submit">Register Doctor</button>
    </form>
  );
}
